	 /* ---- ArrayList and HashSet approach (order maintained) ---- */
	  public static void test_HashSet_listOrder()
	  {
		  List<String> a_master = new ArrayList<String>();
		  
			a_master.add("11");
			a_master.add("22");
			a_master.add("33");
			a_master.add("33");
			
			System.out.println("A!" + a_master);
			
	    ArrayList a = new ArrayList(a_master);
	    long 		cur	 	= System.currentTimeMillis();
	    
	    Set 		set 	= new HashSet();
	    List 		newList = new ArrayList();
	    
	    for (Iterator iter = a.iterator(); iter.hasNext(); ) 
	    {
	      Object element = iter.next();
	      
	      if (set.add(element))
	        newList.add(element);
	    }
	    
	    a.clear();
	    a.addAll(newList);
	    
	    System.out.println("AFter formatting : " + a);
	    
	    long diff = System.currentTimeMillis()-cur;
	    
	    System.out.println("ArrayList/HashSet approach (list order) = "+diff+" ms");
	  }
